import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <nav>
        <ul className="cities">
          <li>Rome</li>
          <li>Paris</li>
          <li>Barcelona</li>
          <li>Lisbon</li>
        </ul>
      </nav>
      <form>
        <input type="search" placeholder="Enter a city" autocomplete="off" />
        <input type="submit" value="Search" />
        <input type="submit" value="Current" />
      </form>
    </div>
  );
}

export default App;
